피부상태에 따른 피부의 화이트닝 케어 서비스를 제공하는 방법으로서,
(a2) 가맹점 단말기(100)가 카메라(105)를 통해 촬영된 사용자의 화이트닝 케어 전후의 피부상태에 대한 사진 데이터를 데이터 입력부(120)를 통해 입력받는 단계(S520);
(b) 상기 가맹점 단말기(100)가 상기 (a2) 단계를 통해 입력받은 사용자의 사진 데이터를 데이터 전송부(150)를 통해 서비스 제공서버(300)에 전송하는 단계(S530);
(c) 서비스 제공서버(300)가 가맹점 단말기(100)를 통해 전송되는 사진 데이터를 바탕으로 하여, db 검색부(350)를 통해 화이트닝 표준지수 db(400)에 저장되어 있는 화이트닝 표준지수 기준표를 검색하는 단계(S540);
(d) 서비스 제공서버(300)가 상기 가맹점 단말기(100)로부터 전달되는 사진 데이터와 상기 db 검색부(350)를 통해 검색된 화이트닝 표준지수를 대조한 후, 색차계 매칭부(360)를 통해 색차가 유사한 조건의 컬러를 매칭하는 단계(S550);
(e) 서비스 제공서버(300)가 데이터 출력부(370)를 통해 상기 색차계 매칭부(360)를 통해 매칭된 컬러의 화이트닝을 개선할 수 있는 레벨의 화이트닝 케어액(170) 조건을 가맹점 단말기(100)에 전달하는 단계(S560); 및
(f) 가맹점 단말기(100)가 상기 서비스 제공서버(300)로부터 수신된 화이트닝 케어액 조건을 참고하여, 사용자의 피부에 맞는 화이트닝 케어액(170)을 바른 후 광조사기(180)를 통해 화이트닝 케어 서비스를 제공받을 수 있도록 하는 단계(S570)를 포함하는 것을 특징으로 하는 피부의 화이트닝 케어 서비스 제공방법.

